"use client";

import React, { useState } from "react";

const AdmissionForm = () => {
  const [formData, setFormData] = useState({
    studentName: "",
    course: "",
    board: "",
    subjects: "",
    joiningDate: "",
    address: "",
    contactNo: "",
    fees: "",
  });

  const [errors, setErrors] = useState({});
  const [responseMessage, setResponseMessage] = useState(null);
  const [showConfirmation, setShowConfirmation] = useState(false);

  const boards = ["CBSE", "ICSE", "State Board", "IB", "Cambridge"];
  const courses = ["Engineering", "Medical", "Commerce", "Arts", "Science"];

  const validate = (name, value) => {
    switch (name) {
      case "studentName":
        if (!value.trim()) return "Student name is required.";
        if (value.length < 3) return "Name must be at least 3 characters.";
        break;
      case "course":
        if (!value) return "Course is required.";
        break;
      case "board":
        if (!value) return "Board is required.";
        break;
      case "subjects":
        if (!value.trim()) return "Subjects are required.";
        break;
      case "joiningDate":
        if (!value) return "Joining date is required.";
        break;
      case "address":
        if (!value.trim()) return "Address is required.";
        if (value.length < 10) return "Address must be at least 10 characters.";
        break;
      case "contactNo":
        if (!value) return "Contact number is required.";
        const phoneRegex = /^[0-9]{10}$/;
        if (!phoneRegex.test(value)) return "Invalid contact number. Must be 10 digits.";
        break;
      case "fees":
        if (!value) return "Fees are required.";
        if (isNaN(value)) return "Fees must be a valid number.";
        break;
      default:
        return null;
    }
    return null;
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
    setErrors({ ...errors, [name]: validate(name, value) });
  };

  const handleSubmit = async () => {
    const validationErrors = Object.keys(formData).reduce((acc, key) => {
      const error = validate(key, formData[key]);
      if (error) acc[key] = error;
      return acc;
    }, {});

    if (Object.keys(validationErrors).length > 0) {
      setErrors(validationErrors);
      return;
    }

    try {
      const response = await fetch("http://localhost:8000/admission/", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify(formData),
      });
      if (!response.ok) throw new Error("Failed to submit admission form");
      setResponseMessage("Admission form submitted successfully!");
      alert("Student added successfully!");
      setFormData({
        studentName: "",
        course: "",
        board: "",
        subjects: "",
        joiningDate: "",
        address: "",
        contactNo: "",
        fees: "",
      });
      setErrors({});
    } catch (error) {
      setResponseMessage("An error occurred. Please try again later.");
    }
    setShowConfirmation(false); // Close confirmation modal
  };

  const handleConfirmation = () => {
    setShowConfirmation(true); // Show confirmation modal
  };

  const handleCancel = () => {
    setShowConfirmation(false); // Close confirmation modal
  };

  return (
    <div className="max-w-lg mx-auto bg-white p-6 rounded shadow mt-10">
      <h2 className="text-3xl font-bold text-center mb-6 text-blue-600">Admission Form</h2>
      {responseMessage && <p className="text-center text-green-500 mb-4">{responseMessage}</p>}
      <form onSubmit={(e) => e.preventDefault()} className="space-y-6">
        {/* Form Fields */}
        {/* Add the input and select fields here */}

        <button
          type="button"
          onClick={handleConfirmation}
          className="w-full bg-blue-600 text-white py-3 rounded hover:bg-blue-700"
        >
          Submit
        </button>
      </form>

      {/* Confirmation Modal */}
      {showConfirmation && (
        <div className="fixed inset-0 bg-gray-600 bg-opacity-50 flex items-center justify-center">
          <div className="bg-white p-6 rounded shadow-lg">
            <h3 className="text-lg font-semibold mb-4">Are you sure you want to submit this form?</h3>
            <div className="flex justify-end space-x-4">
              <button
                onClick={handleSubmit} // Call handleSubmit here directly
                className="bg-green-500 text-white px-4 py-2 rounded hover:bg-green-600"
              >
                Yes
              </button>
              <button
                onClick={handleCancel}
                className="bg-red-500 text-white px-4 py-2 rounded hover:bg-red-600"
              >
                No
              </button>
            </div>
          </div>
        </div>
      )}
    </div>
  );
};

export default AdmissionForm;
